/* COMMON */
* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  font-family: Consolas , serif;
  font-family: "Noto Sans KR", sans-serif;
  color: #333;
}
img {
  display: block;
}
a {
  text-decoration: none;
  color: inherit;
}
.headerbox {
  width: 1600px; 
  margin: 0 auto;
  position: relative;
  padding-bottom: 70px;
  //background-color: rgb(219, 140, 140);
}

/* 노말라이즈 */
ul,
li {
  margin: 0;
  padding: 0;
  list-style: none;
}
h1{
  font-size:50px;
  color: #fff;
}
h5{
