  color: #fff;
}
h3 {
  font-size: 30px;
}

@mixin ButtonCommon {
  text-align: center;
  padding-top: 12px;
  border-radius: 5px;
  width: 234px;
  height: 52px;
  position: absolute;
  top: 100px;
  left: -15px;
  color: black;
}

@mixin BlackButton {
  text-align: center;
  padding-top: 12px;
  border-radius: 5px;
  width: 234px;
  height: 52px;
  position: absolute;
  top: 100px;
  color: white;
  border: 1px solid white;
  background-color: black;
  left: -15px;
}

@mixin CommonText {
  padding-bottom: 10px;
