}

@mixin TitleStyle {
  width: 200px;
  padding-bottom: 200px;
  margin-top: 40px;
  position: absolute;
  left: 25px;
}

/* 노말라이즈 끝 */

/* 배경이미지 작업 시작 */
.backgroundBox {
  width: 100%;
  height: 7200px;
  position:absolute;
}
/* 배경이미지 작업 끝 */


/* HEADER START*/
header {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  height: 70px;
  background-color: white;
  z-index: 200;
  display: flex;
  justify-content: space-between;
  align-items: center;

  .logo img {
      width: 170px;
    }
  
  .logo {
      height: 35px;
      position: absolute;
      bottom: 25px;
      top: 30px;
      margin: auto;
  }

  .main-menu {
    position:absolute;
    width: 790px;
    display: flex;
    opacity: 1;
    bottom: 10px;
    align-items: center;
    text-align: center;
    left: 400px;

    .item .item__name {
      padding: 10px 4px 10px 10px;
      font-size: 17px;
      color: #333;
      transition: all;
    }
  }
 
  .sub-menu {
    position: absolute;
    bottom: 5px;
    right: 0;
    display: flex;
    
    ul.menu {
        display: flex;

        li {
          position: relative;
        }

        li a {
          font-size: 16px;
          padding: 11px 16px;
          display: block;
          color: #656565;
        }
    }  
  }
}
/* HEADER END*/

/* MAIN START*/

@mixin ImgSize {
  background-size: cover;
  background-position: center center;
}

#slider{
  width: 99vw;
  height: 100vh;
  position: relative;
  overflow: hidden;
}
#slider ul{
  position: relative;
  list-style: none;
  width: 9999%;
  right: 3px;
  //transition: all 1s ease;
}
#slider ul li{
  position: relative;
  width: 99vw;
  height: 100vh;
  float: left;
}

.test.active {
  display: block;
  opacity:1;
}
.test {
  position:absolute;
  top:0;
  left:0;
  opacity: 0;
  display: none;
  transition: opacity 1s ease-in-out;
}

#slider ul .test.first{
  background: url("../img/img1.png");
  @include ImgSize;
  position: absolute;
}
#slider ul .test.s{
  background: url("../img/img2.png");
  @include ImgSize;
}
#slider ul .test.t{
  background: url("../img/img3.png");
  @include ImgSize;
}
#slider ul .test.f{
  background: url("../img/img4.png");
  @include ImgSize;
}
#slider ul .test.five{
  background: url("../img/img5.png");
  @include ImgSize;
}
#slider ul .test.six{
